import { Component } from "react";
class Sachin13 extends Component
{
    render(){
        return(
            <div>
                <h1>{this.props.name}</h1>
                <h1>{this.props.address}</h1>
                <h1>{this.props.mobileNo}</h1>
                
                
            </div>
        )
    }
}
export default Sachin13
